package hackerrank.implementation;

import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

public class WeightedUniformStrings {

	static Set<Long> weight = new HashSet<>();
	
    static void countWeight(String s) {
        Map<Character, Long> letters = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            Long count = letters.get(s.charAt(i));
            if (count == null) {
                count = 1L;
            } else {
                count++;
            }

            int code = (int)s.charAt(i) - 96;

            weight.add(code * count);
            letters.put(s.charAt(i), count);
        }
        
        //System.out.println(letters);
        //System.out.println(weight);
    }

    static boolean weightContainsCode(int x) {
        return weight.contains(x);
    }
	
	public static void main(String[] args) {
		String s = "";
	}
}
